import { createTheme } from "@material-ui/core";
import "./App.css";

function App() {
  const theme = createTheme({
    palette: {
      primary: {
        main: "#556cee",
      },
      secondary: {
        main: "#909ff1",
      },
    },
  });
  return <></>;
}

export default App;
